import React from "react";
import TimerInput from "./components/TimerInput";
import Timer from './components/Timer';
import StartButton from './components/StartButton'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: 0
    }
  }

  render() {
    return (
      <>
        <TimerInput />
        <Timer />
        <StartButton />
      </>
    )
  }
}

export default App;
